		/**
		 * Add another World window which will be controlled by this control
		 * @param wwd {WorldWindow}
		 */
		Controls.prototype.addWorldWindow = function(wwd){
			this.wwds.push(wwd);
		};

		/**
		 * Render icons
		 */
