				if (Math.abs(wwd.navigator.heading) > 60) {
					headingIncrement = 2.0;
				} else if (Math.abs(navigator.heading) > 120) {
					headingIncrement = 3.0;
				}
				if (wwd.navigator.heading > 0) {
					headingIncrement = -headingIncrement;
				}

