define('js/models/FilterLayer',[
	'../error/ArgumentError',
	'../util/Logger',
	'../worldwind/layers/MyWmsLayer',

	'jquery'
], function (ArgumentError,
			 Logger,
			 WmsLayer,

			 $) {
	var Location = WorldWind.Location;
	var Sector = WorldWind.Sector;

	// TODO: Server endpoint.
	/**
	 * It represents filtered layer
	 * @param options {Object}
	 * @param options.style {String} Style representation for the server.
	 * @param options.serverUrl {String} Url of the server.
	 * @param options.wmsUrl {String} Url of the GeoServer used for the layer itself.
	 * @param options.stateStore {StateStore} Store for retrieval of current state.
	 * @constructor
	 */
	var FilterLayer = function (options) {
		if(!options.style || !options.wmsUrl || !options.serverUrl || !options.stateStore) {
			throw new ArgumentError(Logger.logMessage(Logger.LEVEL_SEVERE, 'FilterLayer', 'constructor', 'Incorrect parameters'));
		}

		this._style = options.style;

		this._wmsUrl = options.wmsUrl;
		this._baseServerUrl = options.serverUrl;
		this._serverUrl = options.serverUrl + 'rest/geoserver/layer';

		this._stateStore = options.stateStore;

		this._layer = null;
		this._styleId = null;
	};

	/**
	 * It saves the current layer and returns layer to display.
	 * @returns {Promise}
	 */
	FilterLayer.prototype.save = function () {
		var self = this;
		var currentState = this._stateStore.current();
		return $.post(this._serverUrl, {
			style: this._style,
			places: currentState.places,
			analyticalUnitLevel: currentState.analyticalUnitLevel
		}).then(function (result) {
			self._layer = result.layer;
			self._styleId = result.styleId;

			return self.wms(result.layer, result.styleId);
		});
	};

	/**
	 * It cleans the layer from the server.
	 * @returns {*}
	 */
	FilterLayer.prototype.delete = function() {
		if(!this._layer || !this._styleId) {
			throw new ArgumentError(Logger.logMessage(Logger.LEVEL_SEVERE, 'FilterLayer', 'delete', "The layer wasn't saved"));
		}

		return $.ajax({
			url: this._serverUrl,
			method: 'DELETE',
			data: {
				styleId: this._styleId,
				layer: this._layer
			}
		});
	};

	/**
	 * It returns WMS representation of this layer. Maybe it will be exposed at some time.
	 * @param layer {String} String representing queried layers
	 * @param styleId {String} Id of the style used for the query
	 * @private
	 */
	FilterLayer.prototype.wms = function (layer, styleId) {
		this._wmsLayer = layer;
		this._styleId = styleId;

		return new WmsLayer({
			service: this._wmsUrl,
			// This is what is missing
			layerNames: layer,
			sector: new Sector(-90, 90, -180, 180),
			levelZeroDelta: new Location(45, 45),
			numLevels: 14,
			format: "image/png",
			size: 256,
			version: "1.1.1",
			styleNames: styleId,
			opacity: 0.7
		});
	};

	FilterLayer.prototype.serialize = function() {
		return {
			wmsLayer: this._wmsLayer,
			styleId: this._styleId,

			style: this._style,
			wmsUrl: this._wmsUrl,
			serverUrl: this._baseServerUrl,
		}
	};

	FilterLayer.deserialize = function(serialized, stateStore) {
		var layer = new FilterLayer({
			style: serialized.style,
			serverUrl: serialized.serverUrl,
			stateStore: stateStore,
			wmsUrl: serialized.wmsUrl
		});

		layer._wmsLayer = serialized.wmsLayer;
		layer._styleId = serialized.styleId;

		return layer;
	};

	return FilterLayer;
});
define('js/stores/internal/SelectionStore',[
	'../../actions/Actions',
	'../../Config',
	'../../util/Logger',
	'../../util/FilteredSld',
	'../../models/FilterLayer'
], function(
	Actions,
	Config,
	Logger,
	FilteredSld,
	FilterLayer
){
	/**
	 * It actually handles filtering using multiple colors. It has some of the parts of the selection. The filter just
	 * defines selection. The selection has two parts. First part for the selection is showing it on the map.
	 * Second part is showing it in the chart.
	 * Every selection is based upon color.
	 * For the charts part you ned to keep information about areas you want to select.
	 * For the map it is just a layer associated with a color.
	 * @param options {Object}
	 * @param options.dispatcher {Object} Allows adding listeners
	 * @param options.stateStore {StateStore} Store containing state. Necessary for querying the server for base layers.
	 * @constructor
	 */
	var SelectionStore = function(options) {
		/**
		 * For each color you need to keep the information about the selected gids of the areas alongside the map.
		 * The map layer will differ for select single and filters, but it is still part of the standard selection process.
		 * First step is just working with the layers. The rest is handled elsewhere.
		 * @type {{}}
		 * @private
		 */
		this._selected = {};

		this._wmsUrl = Config.geoServerUrl + 'wms';
		this._serverUrl = Config.serverUrl;

		this._stateStore = options.stateStore;

		this._dispatcher = options.dispatcher;

		options.dispatcher.addListener(this.onEvent.bind(this));
	};

	/**
	 * It adds filter to the store.
	 * @param options.attributes {Object}
	 * @param options.color {String} Color of the selection. Based on this information the layer is either added or replaces
	 * 	existing layer.
	 */
	SelectionStore.prototype.addFilter = function(options){
		var color = options.color,
			self = this,
			layer;
		var promise = Promise.resolve(null);
		if(this._selected[color]) {
			promise = this.removeFilter(options);
		}
		return promise.then(function(){
			// Generate sld. This will differ on whether it is filtered or standard.
			return new FilteredSld(options.attributes, color).toString();
		}).then(function(style){
			// Update layers on the server
			layer = new FilterLayer({
				style: style,
				serverUrl: self._serverUrl,
				wmsUrl: self._wmsUrl,
				stateStore: self._stateStore
			});

			return layer.save();
		}).then(function(wmsLayer){
			self._selected[options.color] = {
				layer: layer
			};

			// Add layer among visible.
			self._dispatcher.notify(Actions.mapAddVisibleLayer, {
				layer: wmsLayer
			});
		}).catch(function(error) {
			Logger.logMessage(Logger.LEVEL_SEVERE, 'SelectionStore', 'add', 'Error when creating layer for selection: ' + error);
		});
	};

	/**
	 * It removes layer from the map and server.
	 * @param options {Object}
	 * @param options.color {String} Color of the selection.
	 */
	SelectionStore.prototype.removeFilter = function(options) {
		if(!this._selected[options.color]) {
			Logger.logMessage(Logger.LEVEL_WARN, 'SelectionStore', 'remove', "Tried to remove selection for color which wasn't already shown");
			return Promise.resolve(null);
		}

		var self = this;
		self._dispatcher.notify(Actions.mapRemoveVisibleLayer, {
			layerId: self._selected[options.color].layer.id
		});
		delete self._selected[options.color];

		return Promise.resolve(null);
	};

	SelectionStore.prototype.onEvent = function(type, options) {
		if(type === Actions.filterAdd) {
			this.addFilter(options);
		} else if(type === Actions.filterRemove) {
			this.removeFilter(options);
		}
	};

	SelectionStore.prototype.serialize = function() {
		var keys = Object.keys(this._selected);
		var self = this;
		return keys.map(function(key){
			return {
				color: key,
				layer: self._selected[key].layer.serialize()
			}
		});
	};

	SelectionStore.prototype.deserialize = function(selected) {
		var self = this;
		selected.forEach(function(selected){
			var layer = FilterLayer.deserialize(selected.layer, self._stateStore);
			self._selected[selected.color] = {
				layer: layer
			};

			self._dispatcher.notify(Actions.mapAddVisibleLayer, {
				layer: layer.wms(layer._wmsLayer, layer._styleId)
			});
		});
	};

	return SelectionStore;
});
define('js/view/SnowMapController',[
	'../util/metadata/Attributes',
	'../util/RemoteJQ',
	'../stores/Stores',

	'jquery'
], function (
	Attributes,
	RemoteJQ,
	Stores,

	$
) {
	"use strict";

	var SnowMapController = function(options) {
		this._iFrame = options.iFrame;

		if (options.worldWind){
			this._worldWind = options.worldWind;
		}

		this._countryLayer = null;
		this._previousLayer = null;
		this._previousLayerId = null;
	};

	SnowMapController.prototype.rebuild = function(){
		this._iFrameSelector = $("#" + this._iFrame.getElementId());
		this._iFrameBodySelector = this._iFrameSelector.contents().find("body");
		this.addCompositeShowOnClickListener();
		this.addShowListListener();
		this.addHideListListener();
	};

	SnowMapController.prototype.addShowListListener = function(){
		this._iFrameBodySelector.off("click.compositesList").on("click.compositesList", ".ptr-button.show-list", function(){
			$("#sidebar-reports").addClass("show-map");
			setTimeout(function(){
				Observer.notify("resizeMap");
			},1000);
		});
	};

	SnowMapController.prototype.addHideListListener = function(){
		this._iFrameBodySelector.off("click.compositesOverview").on("click.compositesOverview", ".ptr-button.show-overview", function(){
			$("#sidebar-reports").removeClass("show-map");
		});
	};


	/**
	 * Add listener to iframe inner element
	 */
	SnowMapController.prototype.addCompositeShowOnClickListener = function(){
		var self = this;
		this._iFrameBodySelector.off("click.composites").on("click.composites", ".ptr-composites-composite .ptr-button", function(){
			Observer.notify("getMap");
			self._map = OlMap.map;

			if (!self._countryLayer){
				self._countryLayer = self.addLayerForCountry();
				self._map.addLayer(self._countryLayer);
			}

			var compositeId = $(this).parents(".ptr-composites-composite").attr("data-id");
			var locationKey = self._iFrameBodySelector.find("#composites").attr("data-country");
			var styleId = self._iFrameBodySelector.find("#composites").attr("data-style");

			self.highlightCountry(locationKey);
			self.showCompositeInMap(compositeId, styleId);

			//if (self._worldWind){
			//	self.showCompositeIn3DMap(compositeId);
			//}
		});
	};

	/**
	 * Remove previously added composite layer and show the new one
	 * @param compositeId {string} ID of the layer
	 * @param styleId {string} ID of the style
	 */
	SnowMapController.prototype.showCompositeInMap = function(compositeId, styleId){
		var self = this;
		if (!this._zoomListener){
			this._zoomListener = this._map.events.register("zoomend", this._map, function() {
				self._previousLayer.redraw();
			});
		}

		if (this._previousLayer){
			this._map.removeLayer(this._previousLayer);
		}
		this.addCompositeToMap(compositeId, styleId, 0.7);
	};

	/**
	 * @param compositeId {string} ID of the layer
	 * @param styleId {string} ID of the style
	 * @param opacity {number} layer opacity
	 */
	SnowMapController.prototype.addCompositeToMap = function(compositeId, styleId, opacity){
		var layer = this.createWmsLayer(compositeId, styleId, opacity);
		this._map.addLayer(layer);
		layer.visibility = true;
		layer.opacity = opacity;
		layer.redraw();
		this._previousLayer = layer;
	};

	/**
	 * @param key {string} key of country
	 */
	SnowMapController.prototype.highlightCountry = function(key){
		var self = this;
		this.getCountryData(key).then(function(data){
			var features = [];
			data.forEach(function(country){
				features.push(self.createFeatureFromWkt(country.geom));
			});
			self._countryLayer.destroyFeatures();
			self._countryLayer.addFeatures(features);
			self._countryLayer.redraw();
			var extent = self._countryLayer.getDataExtent();
			self._map.zoomToExtent([extent.left,extent.bottom,extent.right,extent.top]);
		});
	};

	/**
	 * @param layerId {string} ID of the layer
	 * @param styleId {string} ID of the style
	 * @param opacity {number} layer opacity
	 * @returns {OpenLayers.Layer.WMS}
	 */
	SnowMapController.prototype.createWmsLayer = function(layerId, styleId, opacity){
		return new OpenLayers.Layer.WMS(layerId,
			Config.snowUrl + "geoserver/geonode/wms", {
				layers: "geonode:" + layerId,
				styles: styleId
			},{
				opacity: opacity
			});
	};

	/**
	 * Remove layer from 3D map and show the new one
	 * @param compositeId
	 */
	SnowMapController.prototype.showCompositeIn3DMap = function(compositeId){
		if (this._previousLayerId){
			var layer = this._worldWind.layers.getLayerById(compositeId);
			this._worldWind.layers.removeLayer(layer);
		}

		this._worldWind.layers.addWmsLayer({
			id: compositeId,
			url: Config.snowUrl + "geoserver/geonode/wms",
			layerPaths: "geonode:" + compositeId
		}, null, true);
	};

	/**
	 * @returns {OpenLayers.Layer.Vector}
	 */
	SnowMapController.prototype.addLayerForCountry = function(){
		return new OpenLayers.Layer.Vector({
			name: "Selected country"
		});
	};

	/**
	 * @param wkt {string}
	 * @returns {OpenLayers.Feature.Vector}
	 */
	SnowMapController.prototype.createFeatureFromWkt = function(wkt){
		return new OpenLayers.Feature.Vector(new OpenLayers.Geometry.fromWKT(wkt), {}, {
			strokeWidth: 4,
			strokeColor: "#ff0000",
			fillOpacity: 0
		});
	};

	/**
	 * @param countryKey {string}
	 * @returns {*|Promise}
	 */
	SnowMapController.prototype.getCountryData = function(countryKey){
		var self = this;
		return new Attributes().getData({
			changes: {
				scope: true
			},
			config: ThemeYearConfParams
		}).then(function(result){
			var attr = result[0][0];
			if (!attr){
				console.error("There is no attribute for current configuration! Go to backoffice and map attribute to counry key.");
			} else {
				return attr;
			}
		}).then(self.getCountry.bind(self, countryKey));
	};

	/**
	 * @param attribute {Object}
	 * @param countryKey {string}
	 */
	SnowMapController.prototype.getCountry = function(countryKey, attribute){
		var state = Stores.retrieve('state').current();
		return new RemoteJQ({
			url: "rest/filter/attribute/filter",
			params: {
				areaTemplate: state.analyticalUnitLevel,
				periods: state.periods,
				places: state.places,
				attributes: [{
					attribute: attribute.attribute,
					attributeSet: attribute.attributeSet,
					value: [countryKey]
				}]
			}
		}).post();
	};

	return SnowMapController;
});


define('js/view/widgets/SnowWidget/SnowUrlParser',[
	'jquery'
], function(
			$
){
	var SnowUrlParser = function(){
	};

	/**
	 * Parse url
	 * @param url {string} URL of snow portal configuration
	 */
	SnowUrlParser.prototype.parse = function(url){
		//"http://35.165.51.145/snow/great-britain/20170103-20170111/modis-terra-aqua_slstr-sentinel3/4-16"
		// todo replace mock with more sophisticated solution
		var path = url.replace(Config.snowUrl + "snow/","");
		if (path.length < 1){
			return null;
		}

		var components = path.split("/");
		var dates = this.parseDate(components[1]);
		var composites = [];
		var customComposites = components[3];
		if (customComposites && customComposites.charAt(0) != "?"){
			composites = this.parseComposites(components[3]);
		}
		return {
			url: url,
			area: this.parseLocation(components[0]),
			dateFrom: dates[0],
			dateTo: dates[1],
			sensors: this.parseSensors(components[2]),
			composites: composites
		};
	};

	/**
	 * @param locationString {string}
	 * @returns {string}
	 */
	SnowUrlParser.prototype.parseLocation = function(locationString){
		var location = locationString.split("-");
		var locParts = [];
		var self = this;
		location.forEach(function(name){
			name = self.firstLetterToUppercase(name);
			locParts.push(name);
		});
		return locParts.join(" ");
	};

	/**

	 * @param dateString {string}
	 * @returns {[dateFrom, dateTo]}
	 */
	SnowUrlParser.prototype.parseDate = function(dateString){
		var dates = dateString.split("-");
		var dateParts = [];
		var self = this;
		dates.forEach(function(date){
			date = self.getFormattedDate(date);
			dateParts.push(date);
		});
		return dateParts;
	};

	/**
	 * @param sensorsString
	 * @returns {Object} satellites
	 */
	SnowUrlParser.prototype.parseSensors = function(sensorsString){
		var satellites = sensorsString.split("_");
		var sats = {};
		var self = this;
		satellites.forEach(function(str){
			var parts = str.split("-");
			var satellite = parts[0];
			sats[satellite] = [];
			parts.forEach(function(sensor, index){
				if (index > 0){
					var sensorName = self.firstLetterToUppercase(sensor);
					sats[satellite].push(sensorName);
				}
			});
		});
		return sats;
	};

	/**
	 * @param compositesString {string}
	 * @returns {Array}
	 */
	SnowUrlParser.prototype.parseComposites = function(compositesString){
		var composites = compositesString.split("-");
		var compositesParts = [];
		composites.forEach(function(composite){
			compositesParts.push(Number(composite));
		});
		return compositesParts;
	};

	/**
	 * Get date in MM/DD/YYYY format
	 * @param dateString {string}
	 * @returns {string}
	 */
	SnowUrlParser.prototype.getFormattedDate = function(dateString){
		var year = dateString.substring(0,4);
		var month = dateString.substring(4,6);
		var day = dateString.substring(6,8);
		return month + "/" + day + "/" + year;
	};

	/**
	 * Convert first letter of string to uppercase
	 */
	SnowUrlParser.prototype.firstLetterToUppercase = function(word){
		return word.replace(/\w\S*/g, function(txt){return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();})
	};

	return SnowUrlParser;
});

